import React from 'react';
import { Link } from 'react-router-dom';
import ProjectCard from '../components/ProjectCard';
import './Work.css';

const projects = [
  {
    image: '/images/nova_brand.png',
    project: 'Nova Brand',
    client: 'Otava Learning'
  },
  {
    image: '/images/platform.png',
    project: 'Online Learning Platform',
    client: 'Otava Learning'
  },
  {
    image: '/images/nova ai.png',
    project: 'Nova AI',
    client: 'Otava Learning'
  },
  {
    image: '/images/Fira.png',
    project: 'Fira Brand & Website',
    client: 'Fira'
  },
  {
    image: '/images/hel_fi.png',
    project: 'Hel.fi Renewal',
    client: 'City of Helsinki'
  },
  {
    image: '/images/Coding Company.png',
    project: 'Coding Company Brand',
    client: 'Coding Company'
  },
  // ... Add more projects as needed
];

function Work() {
  return (
    <div className="workPage light-background">
      <div className="work-content">
        <h1 className="work-title">Our Work</h1>
        <div className="project-grid">
          <Link to="/work/helfi" className="project-link">
            <ProjectCard
              title="New Hel.fi"
              description="Citizen-centric renewal of the largest website in Finland"
              image="/path/to/helfi-image.jpg"
            />
          </Link>
          {/* Other ProjectCard components remain unchanged */}
        </div>
      </div>
    </div>
  );
}

export default Work;
